    logements.map(logement => isInArray(logement, logementId, logement.id))

    function isInArray(logement, logementId, id) {
        console.log(logement)
        return(
            logementId === id ? console.log(logement)/*
                <div>
                    {logement.cover}

                </div>*/
            : null
        )
    }


}

